import {
  ApolloClient,
  ApolloProvider,
  HttpLink,
  InMemoryCache,
  split
} from '@apollo/client';
import * as firebase from 'firebase';
import 'moment/locale/fr';
import 'moment/locale/sk';
import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import './index.css';
import Login from './pages/LoginPage/Login';
import { AuthProvider } from './providers/UserProvider';
import WeekProvider from './providers/WeekProvider';
import { WebSocketLink } from '@apollo/client/link/ws';
import { getMainDefinition } from '@apollo/client/utilities';

const firebaseConfig = {
  apiKey: 'AIzaSyBT5cY8noKx9w6nuad8Bi1gG56EMLN1fX4',
  authDomain: 'plannerapp-960c1.firebaseapp.com',
  databaseURL: 'https://plannerapp-960c1.firebaseio.com',
  projectId: 'plannerapp-960c1',
  storageBucket: 'plannerapp-960c1.appspot.com',
  messagingSenderId: '58980743581',
  appId: '1:58980743581:web:48f9f868a574b19dda5774'
};

firebase.initializeApp(firebaseConfig);

const httpLink = new HttpLink({
  uri: 'http://localhost:8080/'
});

const wsLink = new WebSocketLink({
  uri: 'ws://localhost:8080/',
  options: {
    reconnect: true
  }
});

const splitLink = split(
  ({ query }) => {
    const definition = getMainDefinition(query);
    return (
      definition.kind === 'OperationDefinition' &&
      definition.operation === 'subscription'
    );
  },
  wsLink,
  httpLink
);

const client = new ApolloClient({
  link: splitLink,
  cache: new InMemoryCache()
});

firebase.auth().onAuthStateChanged((user) => {
  if (user != null) {
    ReactDOM.render(
      <ApolloProvider client={client}>
        <AuthProvider>
          <WeekProvider>
            <App />
          </WeekProvider>
        </AuthProvider>
      </ApolloProvider>,
      document.getElementById('root')
    );
  } else {
    fetch(
      'https://europe-west1-plannerapp-960c1.cloudfunctions.net/app/api/logout'
    ).then((response) => response); //!! no idea what this is (safety check ?)
    ReactDOM.render(<Login />, document.getElementById('root'));
    // User is signed out
  }
});
